import React from 'react';

export default function Header() {
    return (
      <header>
        <nav className='nav'>
          <img src='favicon.ico' alt='React Logo' width={30}/>
          <h1 className='nav-header'>ReactFacts</h1>
          <h4>React Course - Project1</h4>
        </nav>
      </header>
    )
  }
